import React from 'react';
import { ResponsiveContainer, LineChart, Line } from 'recharts';

const pdata = [
    {
        name: 'January',
        fValue: 3,
        sValue: 1
    },
    {
        name: 'January',
        fValue: 3,
        sValue: 1.5
    },
    {
        name: 'January',
        fValue: 4,
        sValue: 3
    },
    {
        name: 'January',
        fValue: 2,
        sValue: 1
    },
    {
        name: 'January',
        fValue: 4,
        sValue: 2.5
    },
    {
        name: 'January',
        fValue: 5,
        sValue: 2
    }
    
]
const ChartMonthlySales = () => {
    return (
        <>
          <ResponsiveContainer width="100">
            <LineChart data={pdata}>
             <Line />
            </LineChart>
          </ResponsiveContainer>
        </>
    )
}

export default ChartMonthlySales;
